    function createButton(text, image, link) {
	const gameButtonsDiv = document.getElementById('gameButtons');
	const button = document.createElement('button');
	button.onclick = () => gameFrame(link);

	const img = document.createElement('img');
	if (image !== "") {
	img.src = image;
} else {
	img.src = `${link}/favicon.ico`;
}
	img.id = "funnyimg"
	img.alt = text;

	const span = document.createElement('span');
	span.textContent = text;
	button.classList = "game-button"
	button.appendChild(img);
	button.appendChild(span);
	gameButtonsDiv.appendChild(button);
}
